import Header from './Header.js';
import Footer from './Footer.js';

function About () {
    return (
        <div class='about'>
            <Header />
            <h1 class="title">Achievements</h1>
            <div className='about-img-container'>
                <p>Contact us!</p>
            </div>
            <Footer />
        </div> 
    )
}

export default About;
